import React, {useEffect, useState} from 'react';
import axios from "axios";
import UsersTabel from "../UsersTabel/UsersTabel";


const UsersRequest = () =>{
    const [state, setState] = useState([])

    useEffect(() =>{
        try {
            const response = axios.get('https://venbest-test.herokuapp.com/');
            response.then(response => setState([...state, response.data]));
        }catch (error) {
            console.log(error)
        }

        }, []);


    return(
        <UsersTabel state={state} />

    )

}

export default UsersRequest;
